import React from 'react'
import Styles from './NavBtn.module.css'


const NavBtn = (props) => {
    function foo(e){
        console.log(foo);
        
        props.cM(e.target.value)
    }
    return (
        <li className={Styles.navBtn}>
            
            <button className={Styles.text}
                onClick={foo}
                value={props.name}>
                {props.name}
            </button>
          
        </li>
    )
}
export default NavBtn
